        { type: 'hydration', priority: 'medium', message: 'Stay hydrated in moderate temperatures' },
        { type: 'sun', priority: 'low', message: 'Low UV risk - sunscreen optional' }
      ]
    },
    'Tokyo': {
      airQuality: {
        aqi: 32, // Good
